script: |
  super -f text -I q11458.spq | sort > q11458.out

inputs:
  - name: q11458.spq
    data: |
      SELECT DISTINCT 38 AS col1 FROM tab0 (FORMAT parquet) WHERE - 24 NOT IN ( col0, + col0 * col0 * - col2, 84 + - col2, + col0, + + col0, + 82 * + + ( - col0 ) );
  - name: tab0

outputs:
  - name: q11458.out
    data: |
      38
